      Hint: Content
      Value: |
        <p>The <a href="http://www.mosquito-awareness.com/" target="_blank">World's Deadliest</a> public awareness campaign has come to Chicago, highlighted by an 11-ft structure of a mosquito that "landed" on a bus stop at State and Lake streets in the heart of the city's downtown. The bus stop also includes informational posters, and other educational panels have been placed in sidewalk displays throughout downtown Chicago.</p>
        <p>The campaign and bus display were featured in the FOX 32 News segment below, and more photos are available on the the <a href="https://www.facebook.com/TheWorldsDeadliest/" target="_blank">World's Deadliest Facebook page</a>.</p>
